                } else if (remainingPlayers > 1) {
                    payable(lowestScorer).transfer(prize);
                    emit WinnerDeclared(_roomId, lowestScorer, prize);
                } else if (remainingPlayers == 0) {
                    payable(owner).transfer(prize);
                    emit NoWinner(_roomId, prize);
